import React, { useEffect, useState } from "react";

export default function Expenses() {
  return (
    <>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Concept</th>
            <th>Amount</th>
            <th>Date</th>
            <th>Category</th>
            <th>Options</th>
          </tr>
        </thead>
      </table>
    </>
  );
}
